void Formant_init(Formant *unit)
{
	
	unit->m_phase1 = 0;
	unit->m_phase2 = 0;
	unit->m_phase3 = 0;
}

//void Formant_process(Formant *unit, int32_t freq1, int32_t freq2, int32_t freq3, int inNumSamples, float* outbuffer){ // freqs are not adjusted to samplerate
void Formant_process(Formant *unit, float freq1in, float freq2in, float freq3in, int inNumSamples, float* outbuffer){ // freqs are adjusted to samplerate
	int32_t phase1 = unit->m_phase1;
	int32_t phase2 = unit->m_phase2;
	int32_t phase3 = unit->m_phase3;
	//	float cpstoinc = unit->m_cpstoinc;
       	int32_t freq1 = (int32_t)(cpstoinc * freq1in);
	int32_t freq2 = (int32_t)(cpstoinc * freq2in);
	int32_t freq3 = (int32_t)(cpstoinc * freq3in);
	

	//////////////
	const float* sine = ftmSine;
	/////////////
	int32_t formfreq = sc_max(freq1, freq3);

	  for (u8 i=0;i<inNumSamples;i++){

		if (phase3 < onecyc13) {
		  		  outbuffer[i] = (*(float*)((char*)sine + (((phase3 + tqcyc13) >> xlobits) & xlomask13)) + 1.f)*  *(float*)((char*)sine + ((phase2 >> xlobits) & xlomask13));
		  //outbuffer[i]=rand()%32768;
			phase3 += formfreq;
		} else {
			outbuffer[i] = 0.f;
		}

		phase1 += freq1;
		phase2 += freq2;
		if (phase1 > onecyc13) {
			phase1 -= onecyc13;
			phase2 = phase1 * freq2 / freq1;
			phase3 = phase1 * freq3 / freq1;
		}
	  }

	unit->m_phase1 = phase1;
	unit->m_phase2 = phase2;
	unit->m_phase3 = phase3;
 }

void Blip_init(Blip *unit)
{
	unit->m_freqin = 100.0f;
	unit->m_numharm = 10;

	int32_t N = unit->m_numharm;
	int32_t maxN = (int32_t)((16000) / unit->m_freqin);
	if (N > maxN) N = maxN;
	if (N < 1) N = 1;
	unit->m_N = N;
	unit->m_scale = 0.5/N;
	unit->m_phase = 0;
}

inline float lininterp(float x, float a, float b)
{
	return a + x * (b - a);
}

inline float PhaseFrac(uint32_t inPhase)
{
	union { uint32_t itemp; float ftemp; } u;
	u.itemp = 0x3F800000 | (0x007FFF80 & ((inPhase)<<7));
	return u.ftemp - 1.f;
}

